INSERT INTO `tb_apprules` (`fd_apprules_id`, `fd_apprules_no`, `fd_apprules_title`, `fd_apprules_content`, `fd_apprules_type`, `fd_apprules_updatetime`) VALUES(1, '1', '通付宝服务协议', '声明与承诺\r\n本协议是用户与通付宝技术有限公司（以下简称“通付宝公司”）之间关于“通付宝手机客户端”软件产品及其提供的服务所拟定的法律协议。本协议在用户和通付宝公司间具有合同上的法律效力。通付宝公司在此特别提醒用户认真阅读、充分理解本协议各条款，特别是其中所涉及的免除、限制通付宝公司责任的条款、对用户权利限制条款、争议解决和法律适用等。一旦安装、复制或以其他方式适用本软件产品，即表示同意接受协议各项条件的约束。如果用户不同意协议中的条款，请勿复制、下周、安装或以其他方式适用本软件。\r\n关于“通付宝”服务协议的确认和接受\r\n2.1 “通付宝”服务由通付宝公司向用户提供“通付宝”软件服务系统（以下简称“通付宝服务”）。为了保障您的权益，您在自愿注册使用通付宝服务前，必须仔细阅读并接受本服务协议所有条款。\r\n2.2 通付宝公司有权在必要时单方修改或变更本服务协议之内容，并将通过通付宝公司网站公布最新服务协议，不另作个别通知。若您于任何修改或变更本服务条款后继续使用本服务，则视为您已阅读、了解并同意接受修改或变更，若您不同意，则您应主动立即停用本服务。\r\n2.3 如您所属国家或地区排除本服务条款内容的全部或部分，则您应立即停止使用通付宝服务。\r\n关于“通付宝”服务的注册\r\n在使用“通付宝”服务前，您必须先注册成为“通付宝”用户，您同意一下事项：\r\n您确认，在您注册成为通付宝用户以接受本服务条款之前，您充分阅读、理解并接受本服务的全部内容，一旦使用本服务，即表示您同意遵循本服务之所有约定。\r\n您同意，通付宝公司有权随时对本服务内容进行单方面的变更，并以公告方式予以公布，无需另行通知;若您在本服务内容公告变更后继续使用本服务的，表示您已充分阅读、理解并接受修改后的内容，若您不同意修改后的服务内容，软件会自动为您停止使用本服务\r\n您同意，基于运动和服务安全的需要，通付宝公司可以暂时停止提供或者限制本服务部分功能提供新的功能，在任何功能减少、增加或者变化，如您继续使用本服务，表示您同意本服务及变更后的服务\r\n您声明，在您同意接受本服务并成功注册为通付宝用户时，您是具有法律规定的完全民事权利能力和民事行为能力，能够独立承担民事责任的自然人、法人或其他组织；本服务内容不受您所属国家或地区的排斥。不具备前述条件的，您应立即终止注册或停止使用本服务，通付宝公司有权自从终止您使用的所有服务\r\n关于“通付宝”服务的守法使用及用户承诺\r\n用户在使用本服务时应遵循中国人民共和国相关法律法规及所在国家或地区之法令及相关国际惯例，不将本服务用于任何非法目的，（包括用于禁止或限制物品的交易），也不能以任何非法方式适用本服务。\r\n用户在使用通付宝公司服务时，必须遵守中国人民共和国相关法律法规的规定，用户应统一将不会利用本服务从事侵害他人合法权益之行为，否则通付宝公司有权拒绝提供本服务，切用户应承担所有相关法律责任，因此导致通付宝公司或者通付宝公司雇员受损的，用户应承担赔偿责任。上述行为包括但不限于：\r\n   1）、 侵害他人名誉权、隐私权、商业秘密、商标权、著作权、专利权等合法权益。违反依法定或约定之保密协议的。\r\n   2）、 从事不法交易行为，如洗钱、贩卖枪支、毒品、禁药、盗版软件、黄色淫秽物品、其他通付宝公司认为不得使用本服务进行交易的物品等。\r\n   3）、 非法使用他人银行账号（包括信用卡账号）或无效银行账号（包括信用卡账号）。\r\n   4）、 其他通付宝公司有正常理由认为不适当之行为。\r\n用户违法本服务或相关的服务条款的规定，导致或产生的任何第三方主张的任何索赔、要求或损失、包括合理的律师费，您同意赔偿通付宝与合作公司、关联公司，并使之免受损害。对此，通付宝有权视用户的行为性质，采取包括但不限于删除用户发布信息内容、暂停使用许可、终止服务、限制使用、回收通付宝账号、追究法律责任等措施。对恶意注册通付宝账号或利用通付宝账号进行违法活动、捣乱、骚扰、欺骗、其他用户以及其他违反本服务的行为，通付宝有权回收其账号。同时，通付宝公司会视司法部门的要求，协助调查。\r\n用户不得对本服务任务部分或本服务之使用或获得，进行复制、拷贝、出售、转售或用于任何其他商业目的。\r\n用户须对自己在使用本服务过程中的行为承担法律责任。用户承担法律责任的形式包括但不限于：对受到侵害者进行赔偿，以及在通付宝公司首先承担了因用户行为导致的行政处罚或侵权损害赔偿责任后，用户应给与通付宝公司等额的赔偿。\r\n服务费用：当您使用通付宝服务时，通付宝公司会向您收取相关服务费用。各项服务费用请详见您使用通付宝服务时通付宝网站上所列之收费方式说明。通付宝公司保留有订定及调整服务费之权利。\r\n您同意，除非另有说明，上述服务费用通付宝公司有权自通付宝公司代收向您支付的款项中扣除。\r\n暂停、拒绝或终止您的使用\r\n您同意通付宝公司有权基于单方独立判断，包括但不限于通付宝公司认为您已经违反本服务条款的规定，将暂停、中断或终止向您提供“通付宝”服务（或其他部分），并将“通付宝”服务内任何“用户资料”加以移除并删除。\r\n您同意通付宝公司在发现异常交易或疑义或有违法之虞时，不经通知有权先行暂停或终止您的账户、密码，并拒绝您使用“通付宝”服务之外部分或全部功能。\r\n您同意在必要时，通付宝公司无需进行事先通知即得终止提供“通付宝”服务，并可能立即暂停、关闭或删除您的账户及您账户中所有相关资料及档案。\r\n通付宝用户账户安全性\r\n您了解并同意，确保密码及账户的机密安全是您的责任，您将对利用该密码及账户所进行的一切行动及言论，负完全的责任，并同意以下事项：\r\n您不可对其他任何人泄露您的账户或密码，亦不可使用其他任何人的账户或密码\r\n您同意如发现有第三人冒用或盗用您的账户和密码，或其他任何未经合法授权的情形，应立即以有效方式通知通付宝公司，同意暂停其使用本服务并采取有效防范措施。通付宝公司在接受您的有效同之前，对第三人使用该服务已发生制效力，除非可证明通付宝公司故意或重大过失而不知是未经合法授权之使用，否则通付宝公司将不承担任何责任。\r\n系统服务中断或故障\r\n系统因下列状况无法正常运作，使用户无法使用各项服务时，通付宝公司对您不负任何赔偿责任，包括但不限于：\r\n通付宝公司系统停机维护期间\r\n手机设备出现故障不能进行数据传输的。\r\n因台风、地震、还小、洪水、停电、战争、恐怖袭击等不可抗力因素，造成通付宝公司系统故障不能执行业务的。\r\n责任范围及责任限制\r\n通付宝公司仅对本协议中所列明的义务承担责任\r\n您明确因交易产生的任何风险应有交易双方承担。\r\n用户信息是有用户自行发布，通付宝公司无法保证用户信息的真实、及时和完整、您应对您的判断承担全部责任\r\n通付宝公司未对交易标的及“通付宝”服务提供任何形式的保证，包括但不限于以下事项：\r\n“通付宝”服务将符合您的需求\r\n“通付宝”服务将不受干扰、及时提供或免于出错。\r\n您经由“通付宝”服务购买或取得之任何产品、服务、资讯或其他资料将符合您的期望。\r\n“通付宝”服务的合作单位，所提供的服务品质及内容由该合作单位自行负责。\r\n您经由“通付宝”服务的使用下载或取得任何资料，应由您自行考量且自负风险，因资料的下载而导致您手机系统的任何损坏或资料六十，您应负完全责任。\r\n您自通付宝供公司及公司工作人员或经由“通付宝”服务取得的建议或咨询，无论其为书面或口头，均不构成通付宝公司对“通付宝”服务的任何保证\r\n在法律允许的情况下，通付宝公司对于与本协议有关或由本协议引起的任何间接的、惩罚性的、特殊的、派生的损失（包括业务损失、收益损失、利润损失、使用数据或其他经济利益损失），不论是如何产生的，也不论是由本协议的违约（包括违反保证）还是由侵权造成的，均不负有任何责任，即使其事先已被告知此等损失的可能性。另外即使本协议规定的排他性救济没用达到其基本目的。也应排除通付宝公司对上述损失的责任。\r\n隐私权保护\r\n通付宝公司重视对用户隐私的保护，关于您的用户资料和其他特定资料依通付宝公司收到保护与规范\r\n知识产权的保护	\r\n手机客户端上所有内容，包括但不限于著作、图片、档案、资讯、资料、网站架构、网站画面的安排、网页设计、均有通付宝公司或其他有权利人依法拥有其知识产权、包括但不限于商标权、专利权、著作权、商业秘密等。\r\n非经通付宝公司或其他权利人书面同意任何人不得擅自使用、修改、复制、公开传播、改变、散步、发行或公开发表软件程序或内容。\r\n尊重知识产权是您应尽的义务。如有违反，您应对通付宝公司承担损害赔偿责任。\r\n服务条款的解释、法律适用及争端解决\r\n通付宝公司对本服务条款拥有最终解释权\r\n本协议及其修订本的有效性、履行和与本协议及其修订本效力有关的所有事宜，将受中华人民共和国法律管辖，任何争议仅适用中国人民共和国法律。\r\n因本协议所引起的用户通付宝公司的任何纠纷或争议，首先应友好协商解决，协商不成的，用户在此完全同意将纠纷或争议提交到通付宝公司所在地人民法院诉讼解决。', 1, NULL);
INSERT INTO `tb_apprules` (`fd_apprules_id`, `fd_apprules_no`, `fd_apprules_title`, `fd_apprules_content`, `fd_apprules_type`, `fd_apprules_updatetime`) VALUES(2, '2', '通付刷钱包服务协议', '通付宝服务协议\r\n声明与承诺\r\n本协议是用户与通付宝技术有限公司（以下简称“通付宝公司”）之间关于“通付宝手机客户端”软件产品及其提供的服务所拟定的法律协议。本协议在用户和通付宝公司间具有合同上的法律效力。通付宝公司在此特别提醒用户认真阅读、充分理解本协议各条款，特别是其中所涉及的免除、限制通付宝公司责任的条款、对用户权利限制条款、争议解决和法律适用等。一旦安装、复制或以其他方式适用本软件产品，即表示同意接受协议各项条件的约束。如果用户不同意协议中的条款，请勿复制、下周、安装或以其他方式适用本软件。\r\n关于“通付宝”服务协议的确认和接受\r\n2.1 “通付宝”服务由通付宝公司向用户提供“通付宝”软件服务系统（以下简称“通付宝服务”）。为了保障您的权益，您在自愿注册使用通付宝服务前，必须仔细阅读并接受本服务协议所有条款。\r\n2.2 通付宝公司有权在必要时单方修改或变更本服务协议之内容，并将通过通付宝公司网站公布最新服务协议，不另作个别通知。若您于任何修改或变更本服务条款后继续使用本服务，则视为您已阅读、了解并同意接受修改或变更，若您不同意，则您应主动立即停用本服务。\r\n2.3 如您所属国家或地区排除本服务条款内容的全部或部分，则您应立即停止使用通付宝服务。\r\n关于“通付宝”服务的注册\r\n在使用“通付宝”服务前，您必须先注册成为“通付宝”用户，您同意一下事项：\r\n您确认，在您注册成为通付宝用户以接受本服务条款之前，您充分阅读、理解并接受本服务的全部内容，一旦使用本服务，即表示您同意遵循本服务之所有约定。\r\n您同意，通付宝公司有权随时对本服务内容进行单方面的变更，并以公告方式予以公布，无需另行通知;若您在本服务内容公告变更后继续使用本服务的，表示您已充分阅读、理解并接受修改后的内容，若您不同意修改后的服务内容，软件会自动为您停止使用本服务\r\n您同意，基于运动和服务安全的需要，通付宝公司可以暂时停止提供或者限制本服务部分功能提供新的功能，在任何功能减少、增加或者变化，如您继续使用本服务，表示您同意本服务及变更后的服务\r\n您声明，在您同意接受本服务并成功注册为通付宝用户时，您是具有法律规定的完全民事权利能力和民事行为能力，能够独立承担民事责任的自然人、法人或其他组织；本服务内容不受您所属国家或地区的排斥。不具备前述条件的，您应立即终止注册或停止使用本服务，通付宝公司有权自从终止您使用的所有服务\r\n关于“通付宝”服务的守法使用及用户承诺\r\n用户在使用本服务时应遵循中国人民共和国相关法律法规及所在国家或地区之法令及相关国际惯例，不将本服务用于任何非法目的，（包括用于禁止或限制物品的交易），也不能以任何非法方式适用本服务。\r\n用户在使用通付宝公司服务时，必须遵守中国人民共和国相关法律法规的规定，用户应统一将不会利用本服务从事侵害他人合法权益之行为，否则通付宝公司有权拒绝提供本服务，切用户应承担所有相关法律责任，因此导致通付宝公司或者通付宝公司雇员受损的，用户应承担赔偿责任。上述行为包括但不限于：\r\n   1）、 侵害他人名誉权、隐私权、商业秘密、商标权、著作权、专利权等合法权益。违反依法定或约定之保密协议的。\r\n   2）、 从事不法交易行为，如洗钱、贩卖枪支、毒品、禁药、盗版软件、黄色淫秽物品、其他通付宝公司认为不得使用本服务进行交易的物品等。\r\n   3）、 非法使用他人银行账号（包括信用卡账号）或无效银行账号（包括信用卡账号）。\r\n   4）、 其他通付宝公司有正常理由认为不适当之行为。\r\n用户违法本服务或相关的服务条款的规定，导致或产生的任何第三方主张的任何索赔、要求或损失、包括合理的律师费，您同意赔偿通付宝与合作公司、关联公司，并使之免受损害。对此，通付宝有权视用户的行为性质，采取包括但不限于删除用户发布信息内容、暂停使用许可、终止服务、限制使用、回收通付宝账号、追究法律责任等措施。对恶意注册通付宝账号或利用通付宝账号进行违法活动、捣乱、骚扰、欺骗、其他用户以及其他违反本服务的行为，通付宝有权回收其账号。同时，通付宝公司会视司法部门的要求，协助调查。\r\n用户不得对本服务任务部分或本服务之使用或获得，进行复制、拷贝、出售、转售或用于任何其他商业目的。\r\n用户须对自己在使用本服务过程中的行为承担