INSERT INTO `tb_apprules` (`fd_apprules_id`, `fd_apprules_no`, `fd_apprules_title`, `fd_apprules_content`, `fd_apprules_type`, `fd_apprules_updatetime`) VALUES(4, '4', '关于我们', '通付宝服务协议\r\n声明与承诺\r\n本协议是用户与通付宝技术有限公司（以下简称“通付宝公司”）之间关于“通付宝手机客户端”软件产品及其提供的服务所拟定的法律协议。本协议在用户和通付宝公司间具有合同上的法律效力。通付宝公司在此特别提醒用户认真阅读、充分理解本协议各条款，特别是其中所涉及的免除、限制通付宝公司责任的条款、对用户权利限制条款、争议解决和法律适用等。一旦安装、复制或以其他方式适用本软件产品，即表示同意接受协议各项条件的约束。如果用户不同意协议中的条款，请勿复制、下周、安装或以其他方式适用本软件。\r\n关于“通付宝”服务协议的确认和接受\r\n2.1 “通付宝”服务由通付宝公司向用户提供“通付宝”软件服务系统（以下简称“通付宝服务”）。为了保障您的权益，您在自愿注册使用通付宝服务前，必须仔细阅读并接受本服务协议所有条款。\r\n2.2 通付宝公司有权在必要时单方修改或变更本服务协议之内容，并将通过通付宝公司网站公布最新服务协议，不另作个别通知。若您于任何修改或变更本服务条款后继续使用本服务，则视为您已阅读、了解并同意接受修改或变更，若您不同意，则您应主动立即停用本服务。\r\n2.3 如您所属国家或地区排除本服务条款内容的全部或部分，则您应立即停止使用通付宝服务。\r\n关于“通付宝”服务的注册\r\n在使用“通付宝”服务前，您必须先注册成为“通付宝”用户，您同意一下事项：\r\n您确认，在您注册成为通付宝用户以接受本服务条款之前，您充分阅读、理解并接受本服务的全部内容，一旦使用本服务，即表示您同意遵循本服务之所有约定。\r\n您同意，通付宝公司有权随时对本服务内容进行单方面的变更，并以公告方式予以公布，无需另行通知;若您在本服务内容公告变更后继续使用本服务的，表示您已充分阅读、理解并接受修改后的内容，若您不同意修改后的服务内容，软件会自动为您停止使用本服务\r\n您同意，基于运动和服务安全的需要，通付宝公司可以暂时停止提供或者限制本服务部分功能提供新的功能，在任何功能减少、增加或者变化，如您继续使用本服务，表示您同意本服务及变更后的服务\r\n您声明，在您同意接受本服务并成功注册为通付宝用户时，您是具有法律规定的完全民事权利能力和民事行为能力，能够独立承担民事责任的自然人、法人或其他组织；本服务内容不受您所属国家或地区的排斥。不具备前述条件的，您应立即终止注册或停止使用本服务，通付宝公司有权自从终止您使用的所有服务\r\n关于“通付宝”服务的守法使用及用户承诺\r\n用户在使用本服务时应遵循中国人民共和国相关法律法规及所在国家或地区之法令及相关国际惯例，不将本服务用于任何非法目的，（包括用于禁止或限制物品的交易），也不能以任何非法方式适用本服务。\r\n用户在使用通付宝公司服务时，必须遵守中国人民共和国相关法律法规的规定，用户应统一将不会利用本服务从事侵害他人合法权益之行为，否则通付宝公司有权拒绝提供本服务，切用户应承担所有相关法律责任，因此导致通付宝公司或者通付宝公司雇员受损的，用户应承担赔偿责任。上述行为包括但不限于：\r\n   1）、 侵害他人名誉权、隐私权、商业秘密、商标权、著作权、专利权等合法权益。违反依法定或约定之保密协议的。\r\n   2）、 从事不法交易行为，如洗钱、贩卖枪支、毒品、禁药、盗版软件、黄色淫秽物品、其他通付宝公司认为不得使用本服务进行交易的物品等。\r\n   3）、 非法使用他人银行账号（包括信用卡账号）或无效银行账号（包括信用卡账号）。\r\n   4）、 其他通付宝公司有正常理由认为不适当之行为。\r\n用户违法本服务或相关的服务条款的规定，导致或产生的任何第三方主张的任何索赔、要求或损失、包括合理的律师费，您同意赔偿通付宝与合作公司、关联公司，并使之免受损害。对此，通付宝有权视用户的行为性质，采取包括但不限于删除用户发布信息内容、暂停使用许可、终止服务、限制使用、回收通付宝账号、追究法律责任等措施。对恶意注册通付宝账号或利用通付宝账号进行违法活动、捣乱、骚扰、欺骗、其他用户以及其他违反本服务的行为，通付宝有权回收其账号。同时，通付宝公司会视司法部门的要求，协助调查。\r\n用户不得对本服务任务部分或本服务之使用或获得，进行复制、拷贝、出售、转售或用于任何其他商业目的。\r\n用户须对自己在使用本服务过程中的行为承担法律责任。